void controlSasuke() {
    
    if (keyPressed == 1) {
        // N
        sasukePos.x = 160;
        sasukePos.y = 100;
    } else if (keyPressed == 2) {
        // NE
        sasukePos.x = 180;
        sasukePos.y = 100;
    } else if (keyPressed == 3) {
        // E
        sasukePos.x = 180;
        sasukePos.y = 120;
    } else if (keyPressed == 4) {
        // SE
        sasukePos.x = 180;
        sasukePos.y = 140;
    } else if (keyPressed == 5) {
        // S
        sasukePos.x = 160;
        sasukePos.y = 140;
    } else if (keyPressed == 6) {
        // SW
        sasukePos.x = 140;
        sasukePos.y = 140;
    } else if (keyPressed == 7) {
        // W
        sasukePos.x = 140;
        sasukePos.y = 120;
    } else if (keyPressed == 8) {
        // NW
        sasukePos.x = 140;
        sasukePos.y = 100;
    } else if (keyPressed == 100) {
        // enable god mode - invincible?
        sasukePos.x = 160;
        sasukePos.y = 120;
    } else {
        // centre
        sasukePos.x = 160;
        sasukePos.y = 120;
    }

    return;
}

void controlNaruto() {
    // if currRasegan reach center, reset and respawn at other location
    // use rasenganInitposition for Naruto too
    if (rasenganPos[currRasengan].x == 160 && rasenganPos[currRasengan].y == 120) {
        currRasengan = rand() % 8;
        rasenganPos[currRasengan].x = rasenganInitPos[currRasengan].x;
        rasenganPos[currRasengan].y = rasenganInitPos[currRasengan].y;
        scoreCounter += 1;
    }

    return;
}

void controlRasengan() {
    rasenganPos[currRasengan].x += rasenganMoveDirection[currRasengan].x * rasenganSpeed;
    rasenganPos[currRasengan].y += rasenganMoveDirection[currRasengan].y * rasenganSpeed;

    return;
}

void await_vsync() {

    volatile int* ptr = (int*)0xff203020;
    register int status;

    *ptr = 1;
    status = *(ptr + 3);

    while ((status & 0x01) != 0) {

        status = *(ptr + 3);

    }

}

