void swap_buffers() {
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer	
}


void plot_pixel_bg(int x, int y, short int line_color) {
    if (x < 0) x = 0;
    else if (x > WIDTH_BG) x = WIDTH_BG;

    if (y < 0) y = 0;

    else if (y > HEIGHT_BG) y = HEIGHT_BG;

    *(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void plot_pixel_sasuke(int x, int y, short int line_color) {
    if (x < 0) x = 0;
    else if (x > WIDTH_SASUKE) x = WIDTH_SASUKE;

    if (y < 0) y = 0;

    else if (y > HEIGHT_SASUKE) y = HEIGHT_SASUKE;

    *(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void plot_pixel_naruto(int x, int y, short int line_color) {
    if (x < 0) x = 0;
    else if (x > WIDTH_NARUTO) x = WIDTH_NARUTO;

    if (y < 0) y = 0;

    else if (y > HEIGHT_NARUTO) y = HEIGHT_NARUTO;

    *(short int*)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


inline void swap(int* a, int* b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}